import React, { useEffect } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Provider } from 'react-redux';
import store from './redux/store';
import LandingPage from './components/LandingPage';
import HomePage from './components/HomePage'
import SearchBar from './components/SearchBar';
import './App.css';
import axios from 'axios';

import {
  GET_DOGS_REQUEST,
  GET_DOGS_SUCCESS,
  GET_DOGS_FAILURE,
  GET_TEMPERAMENTS_REQUEST,
  GET_TEMPERAMENTS_SUCCESS,
  GET_TEMPERAMENTS_FAILURE,
} from './redux/types';

function App() {
  useEffect(() => {
    async function fetchData() {
      try {
        // Setear el estado de la petición a "Loading"
        store.dispatch({ type: GET_DOGS_REQUEST });
        const dogsResponse = await axios.get('http://localhost:3001/dogs');
        const dogs = dogsResponse.data;
        // Setear el estado de la petición a "Success" y enviar los datos
        store.dispatch({ type: GET_DOGS_SUCCESS, payload: dogs });

        // Setear el estado de la petición de temperamentos a "Loading"
        store.dispatch({ type: GET_TEMPERAMENTS_REQUEST });
        const temperamentsResponse = await axios.get('http://localhost:3001/temperaments');
        const temperaments = temperamentsResponse.data.map((t) => t.name);
        // Setear el estado de la petición de temperamentos a "Success" y enviar los datos
        store.dispatch({ type: GET_TEMPERAMENTS_SUCCESS, payload: temperaments });
      } catch (error) {
        // Setear el estado de la petición a "Failure" y enviar el error
        store.dispatch({ type: GET_DOGS_FAILURE, payload: error.message });
        store.dispatch({ type: GET_TEMPERAMENTS_FAILURE, payload: error.message });
      }
    }
    fetchData();
  }, []);

  return (
    <Provider store={store}>
      <div className="App">
        <Router>
          <Switch>
            <Route exact path="/" component={LandingPage} />
            <Route exact path="/home" component={HomePage} />
          </Switch>
        </Router>
      </div>
    </Provider>
  );
}

export default App;
